import React, { useEffect } from 'react';
import { useDispatch } from 'react-redux';

//app
import { RfiDetailsView } from './RfiDetails.view';
import { setDmsTaskContextType, resetDmsTaskTypeContext } from 'stores';
import { DMS_TASK_CONTEXT_TYPE_RFI_RESPONSE } from 'consts';

export default function RfiDetails(props) {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(setDmsTaskContextType({ type: DMS_TASK_CONTEXT_TYPE_RFI_RESPONSE, refId: props?.taskObj?.taskId }));
    return () => dispatch(resetDmsTaskTypeContext());
  }, []); // eslint-disable-line react-hooks/exhaustive-deps

  return <RfiDetailsView {...props} />;
}
